public class Solution {
    public int[] fill(int[] input) {
        if (input == null || input.length < 2) return input;
        for (int i = 0; i < input.length - 1; i++) {
            if (input[i]!= 0 && input[i + 1] == 0) {
                int j = i + 1;
                while (j < input.length && input[j] == 0) j++;
                if (j >= input.length) break;
                if (input[j] == input[i]) {
                    for (int k = i + 1; k <= j; k++) {
                        input[k] = input[i];
                    }
                } else {
                    i--;
                }
            }
        }
        return input;
    }
}
